import React from 'react'
import ground from '../images/ground.jpg';
import './Secondimg.css'
const Secondimg = () => {
  return (
    <div className='headimg'>
        <img src={ground} alt="/" />
        <div className='headtext'>
      <h1>What is the story</h1>
    </div>
    </div>
    
  )
}

export default Secondimg;
